        private fun getDelimiterTokenType(c: Char): IElementType {
            when (c) {
                '"' -> return MarkdownTokenTypes.Companion.DOUBLE_QUOTE
                '\'' -> return MarkdownTokenTypes.Companion.SINGLE_QUOTE
                '(' -> return MarkdownTokenTypes.Companion.LPAREN
                ')' -> return MarkdownTokenTypes.Companion.RPAREN
                '[' -> return MarkdownTokenTypes.Companion.LBRACKET
                ']' -> return MarkdownTokenTypes.Companion.RBRACKET
                '<' -> return MarkdownTokenTypes.Companion.LT
                '>' -> return MarkdownTokenTypes.Companion.GT
                else -> return MarkdownTokenTypes.Companion.BAD_CHARACTER
            }
        }

        /**
         * Translates raw input code points to DFA table row
         */
        private fun zzCMap(input: Int): Int {
            val offset = input and 255
            return if (offset == input) ZZ_CMAP_BLOCKS[offset] else ZZ_CMAP_BLOCKS[ZZ_CMAP_TOP[input shr 8] or offset]
        }

        /**
         * Reports an error that occurred while scanning.
         *
         *
         * In a well-formed scanner (no or only correct usage of `yypushback(int)` and a
         * match-all fallback rule) this method will only be called with things that
         * "Can't Possibly Happen".
         *
         *
         * If this method is called, something is seriously wrong (e.g. a JFlex bug producing a faulty
         * scanner etc.).
         *
         *
         * Usual syntax/scanner level error handling should be done in error fallback rules.
         *
         * @param errorCode the code of the error message to display.
         */
        private fun zzScanError(errorCode: Int) {
            var message: String?
            try {
                message = ZZ_ERROR_MSG!![errorCode]
            } catch (e: ArrayIndexOutOfBoundsException) {
                message = ZZ_ERROR_MSG!![ZZ_UNKNOWN_ERROR]
            }

            throw Error(message)
        }
